import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { getMedicinesByTotalQuantityOrdered } from './api.js'

export default function Profile_admin() {
    const navigate = useNavigate();
    const username = localStorage.getItem('username');
    const [error, setError] = useState(null);
    const [Medicines, setMedicines] = useState([]);

    const goToHome = () => {
        navigate('/');
    };
    const toError = () => {
        navigate('/error');
    };


    useEffect(() => {
        const fetchMedicinesByTotal = async () => {
            try {
                const MedicinesData = await getMedicinesByTotalQuantityOrdered();
                setMedicines(MedicinesData);
            } catch (err) {
                toError();
            }
        };
        fetchMedicinesByTotal();
    }, [username]);

    return (
        <div>
            <h1 className='heading'>Профиль пользователя</h1>
            <h2>Имя пользователя: {username}</h2>
            <div className='container'>
                {error ? (<p>{error}</p>) : (
                    <ul>
                        <h1>Наиболее прибыльные товары:</h1>
                        {Medicines.map(med => (
                            <li key={med.medicineid}>{med.medicineid}</li>
                        ))}
                    </ul>
                )}
            </div>
            <div className='container'>
                <ul>
                    <h1>Наиболее популярные товары:</h1>
                    <li><span>Item 1</span></li>
                    <li><span>Item 2</span></li>
                    <li><span>Item 3</span></li>
                </ul>
            </div>
            <div class="navbar">
                <div class="thq-navbar-nav">
                    <span>© Здоровье в корзине</span>
                    <button className='back'
                        onClick={goToHome} >
                        Выйти
                    </button>
                </div>
            </div>
        </div>
    )
}
